import Header from "./Header";

function Layout(props) {
  return (
    <div>
      <header>
        <Header/>
      </header>

      <main>
        <Container variant className="mt-5" fluid="sm">
          {props.children}
        </Container>
      </main>
    </div>
  );
}

export default Layout;
